import React from 'react';

function Projects() {
    return (
        <React.Fragment>
            <div>
                <h1>Ashley Jones</h1>
                <h2>Junior Full Stack Web Developer</h2>
            </div>
            <section id="portfolio" className="projects">
                <div className="container">
                    <div className="grid">
                        <a href="mailto:thebleufox8@gmail.com">
                            <div className="project">
                                <h3>Email</h3>
                                <h2>thebleufox8@gmail.com</h2>
                            </div>
                        </a>
                        <a href="https://github.com/bleufox" target="blank" rel="noreferrer">
                            <div className="project">
                                <h3>GitHub</h3>
                                <h2>@bleufox</h2>
                            </div>
                        </a>
                        <a href="https://www.linkedin.com/in/bleufox/" target="blank" rel="noreferrer">
                            <div className="project">
                                <h3>LinkedIn</h3>
                                <h2>@bleufox</h2>
                            </div>
                        </a>
                        <a href="https://drive.google.com/file/d/1upQ6iPjUo1oXvPEMFhn8QCgEl-7bJ3Cl/view?usp=sharing" target="blank" rel="noreferrer">
                            <div className="project">
                                <h3>Resume</h3>
                            </div>
                        </a>
                        <a href="mailto:thebleufox8@gmail.com">
                            <div className="project">
                                <h3>LinkedIn</h3>
                                <h2>thebleufox8@gmail.com</h2>
                            </div>
                        </a>
                        <a href="mailto:thebleufox8@gmail.com">
                            <div className="project">
                                <h3>LinkedIn</h3>
                                <h2>thebleufox8@gmail.com</h2>
                            </div>
                        </a>
                    </div>
                </div>
            </section>
            <div class="container">
            <form action="#">
            <label for="fname"></label>
            <input type ="text" name="firstname" placeholder="First Name" />

            <label for="lname"></label>
            <input type ="text" name="lastname" placeholder="Last Name" />

            <select id="project" name="project">
            <option value="empty-option">What would you like to work on?</option>
            <option value="newsite">Brand New Website</option>
            <option value="existingBF">Edits/Updates to an Existing Website Created by Bleu Fox</option>
            <option value="existing3rd">Edits/Updates to an Existing Website (Not Created by Bleu Fox)</option>
            <option value="print">Print Media</option>
            <option value="social">Social Media Branding/Posts</option>
            </select>

            <label for="subject"></label>
            <textarea id="subject" name="subject"
            placeholder="Tell me about your creative needs and together we will bring them to life!"></textarea>

            <button type ="submit" value="Submit">Send</button>
            </form>
            </div>
        </React.Fragment>
    )
}

export default Projects;
